import "./App.css";
import { Switch, Route, Redirect } from "react-router-dom";
import Timer from "./components/Timer";

function App() {
  return (
    <>
      <Header />
      <main>
        <Switch>
        <Route exact path="/">
          <Redirect to="/home"/>
          </Route>    
          <Route path="/home">
          </Route>
          <Route exact path="/history">
            <Cart></Cart>
          </Route>
          <Route exact path="/overview">
          </Route>
        </Switch>
      </main>
    </>
  );
};

export default App;
